    const instance = data.props;

    const [ loaded, setLoaded ] = useState(false); 

    useEffect(()=>{
        console.log(instance);
        setLoaded(true);
    }, [])


    const mapLeaders = instance.map((leader, index) => {
        <div className="point-leader-card" key={index}>
            <p>{ leader.name }</p>
            <p>{ leader.pts }</p>
            <p>{ leader.ast }</p>
            <p>{ leader.img }</p>
        </div>
    })


    if(!loaded) { 
        return (
            <LoadingScreen />
        )
    } else {
        return (
            <div className="point-leaders">
