                    {/* <h4>{second.fn[0]}.{second.ln}</h4>
                    <p>{second.pts}</p>
                    <p>{second.ast}</p> */}
                    {/* Player Img */}
                    {/* <img src={} alt="" /> */}
                </div>

                <div className="point-leader-card">

                    {/* Team Logo */}
                    {/* <img src={} alt="" /> */}
                    {/* <h4>{third.fn[0]}.{third.ln}</h4>
                    <p>{third.pts}</p> */}
                    {/* Player Img */}
                    {/* <img src={} alt="" /> */}
                </div>
            </div>
        )

    };
}

export default PointLeaders;
